import React, { useState } from 'react';
import './App.css';
import CampoTexto from './componentes/CampoTexto';

const App: React.FC = () => {
  // Estados para os campos do formulário
  const [nomeServico, setNomeServico] = useState('');
  const [duracao, setDuracao] = useState('');
  const [preco, setPreco] = useState('');
  const [servicos, setServicos] = useState<any[]>([]); // Estado para armazenar os serviços

  // Manipulador para o envio do formulário
  const handleSubmit = async (e: React.FormEvent<HTMLFormElement>) => {
    e.preventDefault(); // Impede o comportamento padrão do formulário

    // Criar o objeto do serviço a ser enviado
    const novoServico = {
      nome: nomeServico,
      duracao: duracao,
      preco: parseFloat(preco), // Converte o preço para número
    };

    try {
      const response = await fetch('http://localhost:5000/api/servicos', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(novoServico),
      });

      if (response.ok) {
        console.log('Serviço criado com sucesso!');
        setNomeServico('');
        setDuracao('');
        setPreco('');
      } else {
        console.error('Erro ao criar serviço:', response.statusText);
      }
    } catch (error) {
      console.error('Erro na requisição:', error);
    }
  };

  // Manipulador para buscar serviços
  const handleFetchServicos = async () => {
    try {
      const response = await fetch('http://localhost:5000/api/servicos');
      if (response.ok) {
        const data = await response.json();
        setServicos(data); // Armazena os serviços no estado
      } else {
        console.error('Erro ao buscar serviços:', response.statusText);
      }
    } catch (error) {
      console.error('Erro na requisição:', error);
    }
  };

  return (
    <div className="container">
      <header className="header">
        <h1>BelezaMarket</h1>
        <button className="account-button">Minha conta</button>
      </header>

      <main className="main-content">
        <section className="service-form">
          <h2>Cadastre um novo serviço</h2>
          <form onSubmit={handleSubmit}>
            <label>
              Serviço
              <input
                type="text"
                placeholder="Digite o nome do serviço"
                value={nomeServico}
                onChange={(e) => setNomeServico(e.target.value)}
              />
            </label>
            <label>
              Duração
              <input
                type="text"
                placeholder="Digite a duração do serviço"
                value={duracao}
                onChange={(e) => setDuracao(e.target.value)}
              />
            </label>
            <label>
              Preço
              <input
                type="text"
                placeholder="Digite o preço do serviço"
                value={preco}
                onChange={(e) => setPreco(e.target.value)}
              />
            </label>
            <button type="submit">Criar Serviço</button>
            <button type="button" onClick={handleFetchServicos}>Puxar Serviços</button> {/* Botão para puxar serviços */}
          </form>
        </section>

        <section className="registered-services">
          <h2>Serviços Cadastrados:</h2>
          {servicos.length > 0 ? ( // Verifica se há serviços para exibir
            servicos.map((servico, index) => (
              <div className="service-card" key={index}>
                <p>Serviço: {servico.nome}</p>
                <p>Duração: {servico.duracao}</p>
                <p>Preço: {servico.preco.toFixed(2)}</p> {/* Formatação do preço */}
              </div>
            ))
          ) : (
            <p>Nenhum serviço cadastrado.</p> // Mensagem quando não há serviços
          )}
        </section>
      </main>
      <CampoTexto />
    </div>
  );
};

export default App;
